import React from "react";
import "./LoginPage.css";
import { useNavigate } from 'react-router-dom';

function LoginPage() {
    const navigate = useNavigate();

    const handlesignup = () => {
        navigate('/product');
    }

    return (
        <div className="container">
            <p className="title"><h4 className="text">Sign Up</h4></p>
            <div className="underline"></div>
            <div className="login">
                <div className="inputs">
                    <form className="App">
                        <input type="text" placeholder="Name" className="inputField" />
                        <input type="email" placeholder="Email" className="inputField" />
                        <input type="password" placeholder="Password" className="inputField" />
                        <input type="tel" placeholder="Mobile Number" className="inputField" />
                        <br></br>
                        <input type={"submit"} className="submitButton" value="Sign Up" onClick={handlesignup} />
                        <h5>Already have an account?,</h5>
                        <a href="https://www.w3schools.com" className="log">Login</a>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default LoginPage;
